import React from 'react';
import './MonthlyExpensesCard.css';

const MonthlyExpensesCard = ({ expenses }) => (
  <div className="monthly-expenses-card">
    <div className="expenses-title">المصروفات الشهرية</div>
    <ul className="expenses-list">
      {expenses.map((exp, idx) => (
        <li key={idx} className={`expense-item ${exp.color}`}>
          <span>{exp.label}</span>
          <span>{exp.amount} د.ع</span>
        </li>
      ))}
    </ul>
  </div>
);

export default MonthlyExpensesCard;
